      out.write("          <h4 class=\"modal-title\" id=\"myModalLabel3\">LG유플러스 전자결제 서비스 이용약관</h4>\r\n");
      out.write("        </div>\r\n");
      out.write("        <div class=\"modal-body3\">\r\n");
      out.write("            <div class=\"termsAll\">\r\n");
      out.write("          <h5 class=\"mo3title\">전자금융거래 기본 약관(이용자용)</h6>\r\n");
      out.write("            <strong class=\"mo3sub\">제1조 (목적)</strong>\r\n");
      out.write("            \r\n");
      out.write("           <p>\r\n");
      out.write("               이 약관은 전자지급결제대행서비스 및 결제대금예치서비스를 제공하는 주식회사 LG유플러스(이하 '회사'라 합니다)과 이용자 사이의 전자금융거래에 관한 기본적인 사항을 정함으로써 전자금융거래의 안정성과 신뢰성을 확보함에 그 목적이 있습니다.\r\n");
      out.write("           </p> \r\n");
      out.write("\r\n");
      out.write("            <strong class=\"mo3sub\">제2조 (용어의 정의)</strong>\r\n");
      out.write("            <p>\r\n");
      out.write("                이 약관에서 정하는 용어의 정의는 다음과 같습니다.\r\n");
      out.write("\r\n");
      out.write("            </p>\r\n");
      out.write("            <br>\r\n");
      out.write("            <br>\r\n");
      out.write("            <p>\r\n");
      out.write("                \r\n");
      out.write("                ① 전자금융거래'라 함은 회사가 전자적 장치를 통하여 전자지급결제대행서비스 및 결제대금예치서비스(이하 '전자금융거래 서비스'라고 합니다)를 제공하고, 이용자가 회사의 구성원과 직접 대면하거나 의사소통을 하지 아니하고 전산화된 방식으로 이를 이용하는 거래를 말합니다.\r\n");
      out.write("                <br>\r\n");
      out.write("    \r\n");
      out.write("                ② '전자지급결제대행 서비스'라 함은 전자적 방법으로 재화의 구입 또는 용역의 이용에 있어서 지급결제정보를 송신하거나 수신하는 것 또는 그 대가의 정산을 대행하거나 매개하는 서비스를 말합니다.\r\n");
      out.write("                <br>\r\n");
      out.write("    \r\n");
      out.write("                ③ ‘결제대금예치서비스'라 함은 이용자가 재화의 구입 또는 용역의 이용에 있어서 그 대가(이하 '결제대금'이라 한다)의 전부 또는 일부를 재화 또는 용역(이하 '재화 등'이라 합니다)을 공급받기 전에 미리 지급하는 경우, 회사가 이용자의 물품수령 또는 서비스 이용 확인 시점까지 결제대금을 예치하는 서비스를 말합니다.\r\n");
      out.write("                <br>\r\n");
      out.write("    \r\n");
      out.write("                ④ '이용자'라 함은 이 약관에 동의하고 회사가 제공하는 전자지급결제대행 서비스를 이용하는 자를 말합니다.\r\n");
      out.write("                <br>\r\n");
      out.write("    \r\n");
      out.write("                ⑤ '접근매체'라 함은 전자금융거래에 있어서 거래지시를 하거나 이용자 및 거래내용의 진실성과 정확성을 확보하기 위하여 사용되는 수단 또는 정보로서 전자식 카드 및 이에 준하는 전자적 정보(신용카드번호를 포함한다), '전자서명법'상의 인증서, 금융기관 또는 전자금융업자에 등록된 이용자번호, 이용자의 생체정보, 이상의 수단이나 정보를 사용하는데 필요한 비밀번호 등 전자금융거래법 제2조 제10호에서 정하고 있는 것을 말합니다.\r\n");
      out.write("                <br>\r\n");
      out.write("    \r\n");
      out.write("                ⑥ '거래지시'라 함은 이용자가 전자금융거래계약에 따라 금융기관 또는 전자금융업자에게 전자금융거래의 처리를 지시하는 것을 말합니다.\r\n");
      out.write("                <br>\r\n");
      out.write("    \r\n");
      out.write("                ⑦ '오류'라 함은 이용자의 고의 또는 과실 없이 전자금융거래가 전자금융거래계약 또는 이용자의 거래지시에 따라 이행되지 아니한 경우를 말합니다.\r\n");
      out.write("\r\n");
      out.write("            </p>    \r\n");
      out.write("\r\n");
      out.write("            <strong class=\"mo3sub\">제3조 (약관의 명시 및 변경)</strong>\r\n");
      out.write("            <p>\r\n");
      out.write("                \r\n");
      out.write("                ① 회사는 이용자가 전자지급결제대행 서비스를 이용하기 전에 이 약관을 게시하고 이용자가 이 약관의 중요한 내용을 확인할 수 있도록 합니다.\r\n");
      out.write("                <br>\r\n");
      out.write("    \r\n");
      out.write("                ② 회사는 이용자의 요청이 있는 경우 서면제공 방식 또는 전자문서의 전송방식에 의하여 본 약관의 사본을 이용자에게 교부합니다.\r\n");
      out.write("                <br>\r\n");
      out.write("                ③ 회사가 약관을 변경하는 때에는 그 시행일 1월 전에 변경되는 약관을 지급결제정보 입력화면 및 회사의 홈페이지에 게시함으로써 이용자에게 공지합니다.\r\n");
      out.write("                \r\n");
      out.write("            </p>            \r\n");
      out.write("\r\n");
      out.write("            <strong class=\"mo3sub\">제4조 (전자지급결제대행서비스의 종류)</strong>\r\n");
      out.write("            <p>\r\n");
      out.write("                \r\n");
      out.write("                회사가 제공하는 전자지급결제대행서비스는 지급결제수단에 따라 다음과 같이 구별됩니다.\r\n");
      out.write("                <br>\r\n");
      out.write("                \r\n");
      out.write("                ① 신용카드결제대행서비스: 이용자가 결제대금의 지급을 위하여 제공한 지급결제수단이 신용카드인 경우로서, 회사가 전자결제시스템을 통한 신용카드 지불정보의 송,수신 및 결제대금의 정산을 대행하거나 매개하는 서비스를 말합니다.\r\n");
      out.write("                <br>\r\n");
      out.write("                ② 계좌이체대행서비스: 이용자가 결제대금을 회사의 전자결제시스템을 통하여 금융기관에 등록한 자신의 계좌에서 출금하여 원하는 계좌로 이체할 수 있는 실시간 송금 서비스를 말합니다.\r\n");
      out.write("                <br>\r\n");
      out.write("    \r\n");
      out.write("                ③ 가상계좌서비스: 이용자가 결제대금을 현금으로 결제하고자 경우 회사의 전자결제시스템을 통하여 자동으로 이용자만의 고유한 일회용 계좌의 발급을 통하여 결제대금의 지급이 이루어지는 서비스를 말합니다.\r\n");
      out.write("                <br>\r\n");
      out.write("    \r\n");
      out.write("                ④ 기타: 회사가 제공하는 서비스로서 지급결제수단의 종류에 따라 '휴대폰 결제대행서비스', 'KT전화(ARS,폰빌)결제대행서비스', '상품권결제대행서비스'등이 있습니다.\r\n");
      out.write("            </p>\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("            <strong class=\"mo3sub\">제5조 (결제대금예치서비스의 내용)</strong>\r\n");
      out.write("            <p>\r\n");
      out.write("                \r\n");
      out.write("                ① 이용자(이용자의 동의가 있는 경우에는 재화 등을 공급받을 자를 포함합니다. 이하 본조에서 같습니다)는 재화 등을 공급받은 사실을 재화 등을 공급받은 날부터 3영업일 이내에 회사에 통보하여야 합니다.\r\n");
      out.write("                <br>\r\n");
      out.write("    \r\n");
      out.write("                ② 회사는 이용자로부터 재화 등을 공급받은 사실을 통보 받은 후 회사와 통신판매업자간 사이에서 정한 기일 내에 통신판매업자에게 결제대금을 지급합니다.\r\n");
      out.write("                <br>\r\n");
      out.write("    \r\n");
      out.write("                ③ 회사는 이용자가 재화 등을 공급받은 날부터 3영업일이 지나도록 정당한 사유의 제시 없이 그 공급받은 사실을 회사에 통보하지 아니하는 경우에는 이용자의 동의 없이 통신판매업자에게 결제대금을 지급할 수 있습니다.\r\n");
      out.write("                <br>\r\n");
      out.write("    \r\n");
